import { createRoot } from "react-dom/client";

import "./index.css";

const ToDoApp = () => {
  return (
    <section className="todoapp">
      <header className="header">
        <h1>todos</h1>
        <input
          className="new-todo"
          placeholder="What needs to be done?"
          autoFocus
        />
      </header>
    </section>
  );
};

const section = document.getElementById("root");
const root = createRoot(section);
root.render(<ToDoApp />);
